Before the invention of the sawmill, boards were made in various <a title="Manual labour" href="https://en.wikipedia.org/wiki/Manual_labour">manual</a> ways, either <a title="Wood splitting" href="https://en.wikipedia.org/wiki/Wood_splitting">rived (split)</a> and <a title="Plane (tool)" href="https://en.wikipedia.org/wiki/Plane_(tool)">planed</a>, <a title="Hewing" href="https://en.wikipedia.org/wiki/Hewing">hewn</a>, or more often <a title="Hand saw" href="https://en.wikipedia.org/wiki/Hand_saw">hand sawn</a> by two men with a <a title="Whipsaw" href="https://en.wikipedia.org/wiki/Whipsaw">whipsaw</a>, one above and another in a <a title="Saw pit" href="https://en.wikipedia.org/wiki/Saw_pit">saw pit</a> below. The earliest known mechanical mill is the <a title="Hierapolis sawmill" href="https://en.wikipedia.org/wiki/Hierapolis_sawmill">Hierapolis sawmill</a>, a Roman water-powered stone mill at <a title="Hierapolis" href="https://en.wikipedia.org/wiki/Hierapolis">Hierapolis</a>, <a class="mw-redirect" title="Asia Minor" href="https://en.wikipedia.org/wiki/Asia_Minor">Asia Minor</a> dating back to the 3rd century AD. Other water-powered mills followed and by the 11th century they were widespread in Spain and North Africa, the Middle East and Central Asia, and in the next few centuries, spread across Europe. The circular motion of the wheel was converted to a reciprocating motion at the saw blade. Generally, only the saw was powered, and the logs had to be loaded and moved by hand. An early improvement was the development of a movable carriage, also water powered, to move the log steadily through the saw blade.
